import React from "react";
import NavBar from "../components/NavBar";
import Header from "../components/Header";
import Footer from "../components/Footer";
import DashboardContent from "./dashboard";


function Home() {
  return (
    <div>
      <Header />
      <NavBar />
      <DashboardContent />
      <Footer />
    </div>
  );
}

export default Home;
